with fun interacts1_total($c: character) -> integer:
    match $r1 isa interacts1 (character1: $c);
    $r1 has weight $w1;
    return sum($w1);
with fun interacts2_total($c: character) -> integer:
    match $r2 isa interacts2 (character1: $c);
    $r2 has weight $w2;
    return sum($w2);
match
$c isa character;
let $total = interacts1_total($c) + interacts2_total($c);
sort $total desc;
limit 5;
fetch {
    "characterName": $c.name,
    "totalWeight": $total
};

