$rel isa interacts3 (character1: $c1, character2: $c2), has weight $w;
$w > 50;
fetch {
  "Character1": $n1,
  "Character2": $n2,
  "InteractionWeight": $w
};

match
$c1 isa character;
$c2 isa character;
$rel isa interacts2 (character1: $c1, character2: $c2);
$rel has weight $w;
fetch {
  "Character1": $c1.name,
  "Character2": $c2.name,
  "InteractionWeight": $w
